        <Button
          text="neuer Post"
          className2="w-100 mt-4"
          variant="secondary"
          onClick={function () {
            showInFront('<div id="newPost" class="border container inFront" style="right: 92.5px; top: 248px;"><div class="nichtRund card"><div class="p-0 m-0 card-header"><div class="App p-0 "><form class="p-0 p-1 nichtRund"><div class="p-0 m-0 form-group"><input placeholder="Postüberschrift" class="form-control"></div></form></div></div><div class="p-0 card-body"><div class="container"><div class="border nichtRund container"><div class="p-0 m-3 card-body"><div><div class="dad" tabindex="0"><input accept="image/*" multiple="" type="file" autocomplete="off" tabindex="-1" style="display: none;"><div id="dadPlatzhalter">sss</div><div class="draganddopBild"></div></div></div></div><div class="mt-4 p-0 bg-white card-footer"><button type="button" class="btn btn-secondary"><h4><svg stroke="currentColor" fill="currentColor" stroke-width="0" viewBox="0 0 24 24" class="Icon" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg"><path d="M20,2H8C6.897,2,6,2.897,6,4v12c0,1.103,0.897,2,2,2h12c1.103,0,2-0.897,2-2V4C22,2.897,21.103,2,20,2z M8,16V4h12 l0.002,12H8z"></path><path d="M4,8H2v12c0,1.103,0.897,2,2,2h12v-2H4V8z"></path><path d="M12 12L11 11 9 14 19 14 15 8z"></path></svg></h4></button><button type="button" class="m-2 btn btn-secondary"><h4><svg stroke="currentColor" fill="currentColor" stroke-width="0" viewBox="0 0 24 24" class="Icon" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg"><path d="M20,2H8C6.897,2,6,2.897,6,4v12c0,1.103,0.897,2,2,2h12c1.103,0,2-0.897,2-2V4C22,2.897,21.103,2,20,2z M8,16V4h12 l0.002,12H8z"></path><path d="M4,8H2v12c0,1.103,0.897,2,2,2h12v-2H4V8z"></path><path d="M12 12L11 11 9 14 19 14 15 8z"></path></svg></h4></button></div></div></div></div><div class="p-0 card-footer"><div class="App p-0 "><form class="p-0 p-1"><div class="p-0 m-0 form-group"><input placeholder="Text" class="form-control"></div></form><');
          }}
        ></Button>
